window.bookSummaryJSON = "<p><b>The zombie apocalypse is the only thing worse than a geometry pop quiz....&nbsp;&nbsp;</b><br> <br> Boxford High pranksters cause a chemistry lab to go wrong and students face something far worse than SATs and cafeteria lunches - an infection turning students into zombies scouring the halls for human flesh.&nbsp;</p> <p>A group of unlikely companions; an artistic goth, star-athlete jock, disgruntled loner, would-be marine, sassy cheerleader, and angry Asian, fend off the living dead. As they fight through locker rooms and dance their way across the theater, they find surviving the zombie apocalypse is more complicated than puberty.&nbsp;<br> <br> Will they be able to put aside their differences and fend off the zombie hoard before the infection reaches beyond the walls of their suburban high school?&nbsp;&nbsp;<br> <br> Buy the Suburban Zombie High today and embrace the over-the-top horror of being a teenager as the world burns to the ground.</p> <p><b>Suburban Zombie High Series</b></p> <ul> <li>Suburban Zombie High</li> <li>Suburban Zombie High: The Reunion</li> <li>Suburban Zombie High: Final Class</li> </ul>"; 
